- 本API不支持查询通过控制台手动导出的SQL洞察日志文件，只支持查询通过[DescribeSQLLogRecords](~~610533~~)API生成（请求参数**Form**取值为**File**）的SQL洞察文件列表。
- 本API导出的文件仅保留2天。
  > 当开通了DAS企业版 V2和企业版 V3，使用其提供的SQL洞察和审计功能时，导出的文件保留7天。通过[DescribeSqlLogConfig](~~2778837~~)可以查询开通的企业版信息。',
